import React from 'react'

export const DeleteReducer = (state, action) => {
    switch(action.type){
        case('CANCEL'):
        return [{controller: action.close}]
        case('OPEN'):
        return [{controller: action.open}]
        case('CONTROLLER'):
        return state
        default:
            state
    }
}
